// DouyinAuthServer is the server API for DouyinAuth service.
type DouyinAuthServer interface {
	// 上传材料
	UploadMaterial(context.Context, *UploadMaterialRequest) (*UploadMaterialResponse, error)
	// 代运营服务商帮老师或代运营模式机构入驻
	Bypartner(context.Context, *BypartnerRequest) (*BypartnerResponse, error)
	// 自营机构/服务商入驻
	BySelf(context.Context, *BySelfRequest) (*BySelfResponse, error)
	// 新增角色
	AddRole(context.Context, *AddRoleRequest) (*AddRoleResponse, error)
	// 查询基础认证资质
	GetBasicAuth(context.Context, *GetBasicAuthRequest) (*GetBasicAuthResponse, error)
	// 更新基础认证资质
	UpdateBasicAuth(context.Context, *UpdateBasicAuthRequest) (*UpdateBasicAuthResponse, error)
	// 查询类目认证资质
	GetClassAuth(context.Context, *GetClassAuthRequest) (*GetClassAuthResponse, error)
	// 更新类目认证资质
	UpdateClassAuth(context.Context, *UpdateClassAuthRequest) (*UpdateClassAuthResponse, error)
	// 添加类目认证资质
	AddClassAuth(context.Context, *AddClassAuthRequest) (*AddClassAuthResponse, error)
	// 获取审核任务详情
	GetAuditDetail(context.Context, *GetAuditDetailRequest) (*GetAuditDetailResponse, error)
	// 小程序绑定角色
	BindRole(context.Context, *BindRoleRequest) (*BindRoleResponse, error)
	// 小程序解除绑定角色
	UnbindRole(context.Context, *UnbindRoleRequest) (*UnbindRoleResponse, error)
	// 查询小程序已绑定的角色
	GetBindList(context.Context, *GetBindListRequest) (*GetBindListResponse, error)
	// 角色授权小程序
	AuthRole(context.Context, *AuthRoleRequest) (*AuthRoleResponse, error)
	// 解除授权小程序
	UnauthRole(context.Context, *UnauthRoleRequest) (*UnauthRoleResponse, error)
	// 查询授权小程序
	GetAppidAuth(context.Context, *GetAppidAuthRequest) (*GetAppidAuthResponse, error)
	// 更新授权小程序授权信息
	UpdateAuthLetter(context.Context, *UpdateAuthLetterRequest) (*UpdateAuthLetterResponse, error)
	// 查询抖音号绑定、能力授权
	QueryMountscope(context.Context, *QueryMountscopeRequest) (*QueryMountscopeResponse, error)
	// 新增抖音号绑定、能力授权
	EnableMountscope(context.Context, *EnableMountscopeRequest) (*EnableMountscopeResponse, error)
	// 解除抖音号绑定、解除能力授权
	UnbindAccount(context.Context, *UnbindAccountRequest) (*UnbindAccountResponse, error)
	// 查询实体ID
	QueryEntityInfo(context.Context, *QueryEntityInfoRequest) (*QueryEntityInfoResponse, error)
	// 查询实体已绑定抖音号列表
	QueryBindTocList(context.Context, *QueryBindTocListRequest) (*QueryBindTocListResponse, error)
}

